import { auth } from "../config/firebase";

export const Main = () => {
    return (
        <div>
            <h1>Home Page</h1>
            { auth != null ? <div>
                <p>{auth.currentUser?.displayName}</p>
                <img src={auth.currentUser?.photoURL || ""} style={{borderRadius: 50}}/>
            </div> : "You need to Login"}
        </div>
    );
}
